import "./App.css";
import { Routes, Route } from "react-router-dom";
import Home from "./pages/Home";
import Login from "./pages/Login";

function App() {
  return (
    <Routes>
      <Route exact path="/" element={<Home />} />
      <Route exact path="/user/login" element={<Login />} />
      {/* Not Found Route */}
      <Route exact path="*"/>
    </Routes>
  );
}

export default App;
